con:config.script:
//log.info('ctxt-nm in script step ' + context.name);
//log.info('test case ctxt in script step ' + testRunner.runContext);
def loadTestContext = testRunner.runContext.getProperty('LoadTestContext');

def studyArr = loadTestContext.getProperty('studyIds');
def orgsArr = loadTestContext.getProperty('siteIds');
def dobArr = loadTestContext.getProperty('dobArr');
def sexArr = loadTestContext.getProperty('sexArr');

log.info('studyArr=' + studyArr);
log.info('orgsArr=' + orgsArr);

String offsiteIndex = testRunner.testCase.testSteps["Properties"].getPropertyValue("offsetSite");
int offSite = Integer.parseInt(offsiteIndex);
if ( context.RunCount == 3489 ) { // Thread completed its cycle.

	// update how many are completed its cycles
	String updateThreads = testRunner.testCase.testSteps["Properties"].getPropertyValue("updateThreads");
	int updateThreadsVal  = Integer.parseInt(updateThreads);
	updateThreadsVal = updateThreadsVal + 1;

	 testRunner.testCase.testSteps["Properties"].setPropertyValue("updateThreads",String.valueOf(updateThreadsVal) );

	String userSpecifiedThreads = testRunner.testCase.testSteps["Properties"].getPropertyValue("userSpecifiedThreads");
	int userSpecifiedThreadsVal = Integer.parseInt(userSpecifiedThreads);

	if (updateThreadsVal == userSpecifiedThreadsVal ) {
		 testRunner.testCase.testSteps["Properties"].setPropertyValue("updateThreads","0");
		  testRunner.testCase.testSteps["Properties"].setPropertyValue("offsetSite",String.valueOf(offSite+userSpecifiedThreadsVal) );
	}
}

int participantIndex = context.RunCount/studyArr.size;
int studyIndex = context.RunCount%studyArr.size;

int dobIndex = context.RunCount%dobArr.size;
int sexIndex = context.RunCount%sexArr.size;

String study = studyArr[studyIndex].replaceAll("[,.\\-\\s+\\n\\t+]", "");
String StudySubjectId = study + "." + participantIndex + "." + System.currentTimeMillis() ;

testRunner.testCase.testSteps["Properties"].setPropertyValue("studyId",studyArr[studyIndex]);
testRunner.testCase.testSteps["Properties"].setPropertyValue("nciCode",orgsArr[offSite+context.ThreadIndex]);
testRunner.testCase.testSteps["Properties"].setPropertyValue("dob",dobArr[dobIndex]);
testRunner.testCase.testSteps["Properties"].setPropertyValue("sex",sexArr[sexIndex]);
testRunner.testCase.testSteps["Properties"].setPropertyValue("StudySubjectId",StudySubjectId);
testRunner.testCase.testSteps["Properties"].setPropertyValue("participantIndex",String.valueOf(participantIndex));
testRunner.testCase.testSteps["Properties"].setPropertyValue("study",study);
